import React from 'react';
import { Card } from 'react-bootstrap';

function Covid (){
    return (
        <div>
            <div className="container">
                <h3 className="text-center">
                    疫情專區
                </h3>
                <div className="row d-flex justify-content-center">
                    <div className="col-sm-5">
                        <Card>
                            <Card.Img src="https://images.unsplash.com/photo-1536607278842-2e762f290252?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80" />
                        </Card>
                    </div>
                    <div className="col-sm-5">456</div>
                </div>
            </div>
        </div>
    )
}
export default Covid;
